 (1,'تست','تست',1,0),
 (2,'تسويه حساب پايان سال','همكار گرامي \r\nطبق روال سالهاي قبل رسيدگي به حسابها و تسويه كامل در بهمن ماه مي باشد، خواهشمند است جهت كنترل حساب في مابين با شماره تلفن 09123895178 تماس حاصل فرموده و نسبت به تسويه حساب تا قبل از تاريخ 20/11/1386 اقدام نماييد.\r\nلذا دريافت صورت درخواستي بعد از تاريخ مذكور منوط به تسويه حساب كامل بوده و در غير اينصورت از ادامه همكاري معذوريم.',1,1);
